import React from 'react';
import Message from '../../1HelpFullFolder/Message';
import { View, Text } from 'react-native';
import { mySelfUser } from '../../1HelpFullFolder/Initialization';
interface LastMessageStatusProps {
  lastMessage: Message | undefined;
}

const LastMessageStatus: React.FC<LastMessageStatusProps> = ({ lastMessage }) => {
  if (!lastMessage) {
    return null;
  }

  return (
    <View>
      {lastMessage.sender === mySelfUser ? (
        <Text>Sent</Text>
      ) : (
        <Text>Received</Text>
      )}
    </View>
  );
};

export default LastMessageStatus;
